import react from 'react';
import './Chessboard.css';
import Square from './Square';
import { PawnModel } from '../../../../model/PawnModel';
import { ChessBoardModel } from '../../../../model/ChessBoardModel';

export default function Chessboard(props:{playerColor:string}){
    const playerColor = props.playerColor;

    const boardModel = new ChessBoardModel(playerColor).genChessBoard();
    const board:any = [[],[],[],[],[],[],[],[]];

    for(let i = 0; i<8; i++){
        for(let j = 0; j<8; j++){
            board[i].push(
                <Square color={boardModel[i][j].getColor()} pos={boardModel[i][j].getPos()} piece={boardModel[i][j].getPiece()}></Square>
            );
        }
    }
    return(
        <div id = "chessboard">
            {board}
        </div>
    );
}
